description:
&quot;bedroom songs&quot; is a collection of lullabies. the songs were recorded in one sitting each, in the middle of the night in the middle of the summer. it was hot.

the first pressing consisted of only one copy, handmade with a handwritten insert. the album art is from the 2007 reissue. it is drawn by emma sartwell, and the title was purposely left blank so that one could customize their own title. popular ones included &quot;parade parade and his melancholy whores,&quot; &quot;parade parade and simon and garfunkel,&quot; and &quot;parade parade and stop telling chuck norris jokes, start living your life.&quot; 


